response.about:
Если говорить о том, чем может характеризоваться названная программа, то мы бы описали ее как систему, объединяющую несколько направлений:
Самостоятельное формирование человеком собственного мировоззрения, что предполагает специальную постановку в самообразовании принципиальных мировоззренческих вопросов и включение всех образовательных курсов в этот процесс;
Сохранение у людей естественного контакта с миром живой природы, что представляется совершенно необходимой основой для порождения гуманного и мудрого отношения к ней;
Открытость, свобода мышления, готовность воспринять, осмыслить другие модели и подходы;
Знакомство со своим внутренним миром – с закономерностями функционирования психики, ума, приводящее к осмыслению значения духовных ценностей для общего счастья в человеческой жизни;
